"use strict";(self.webpackChunkmy_website=self.webpackChunkmy_website||[]).push([[1477],{10:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"AAA","metadata":{"permalink":"/blog/AAA","source":"@site/blog/2024-01-21-How-to-docusaurus/docusaurus-website.md","title":"How to make a markdown website","description":"Prerequisition","date":"2024-01-21T00:00:00.000Z","formattedDate":"January 21, 2024","tags":[{"label":"md","permalink":"/blog/tags/md"},{"label":"markdown website","permalink":"/blog/tags/markdown-website"},{"label":"docusaurus","permalink":"/blog/tags/docusaurus"}],"readingTime":2.66,"hasTruncateMarker":false,"authors":[{"name":"Yimin Qiu","title":"Helper & learner","url":"https://github.com/tony20141","imageURL":"https://avatars.githubusercontent.com/u/60122866?s=400&u=04bd04ca632e625b294ee33c3f4f549b626b2c8c&v=4","key":"yimin"}],"frontMatter":{"slug":"AAA","title":"How to make a markdown website","authors":"yimin","tags":["md","markdown website","docusaurus"]},"unlisted":false,"nextItem":{"title":"Linux note","permalink":"/blog/welcome-docusaurus-v2"}},"content":"## Prerequisition  \\r\\n\\r\\n\\r\\n    1. Node.js    \\r\\n        > https://nodejs.org/en/download/\\r\\n    2. Open node.js CMD  \\r\\n    3. npm install npx   \\r\\n    4. npx create-docusaurus@latest my-website classic //create a website names my-website  \\r\\n        > error: no such file or directory, lstat \'C:\\\\Users\\\\qq\\\\AppData\\\\Roaming\\\\npm\'  \\r\\n        > solution: manually create the npm folder there  \\r\\n    5. cd my-website  \\r\\n    6. npm start  \\r\\n\\r\\n\\r\\n##  Project structure {#project-structure}   \\r\\n\\r\\nAssuming you chose the classic template and named your site my-website, you will see the following files generated under a new directory my-website/:  \\r\\n\\r\\nAssuming you chose the classic template and named your site `my-website`, you will see the following files generated under a new directory `my-website/`:\\r\\n\\r\\n```bash\\r\\nmy-website\\r\\n\u251c\u2500\u2500 blog\\r\\n\u2502   \u251c\u2500\u2500 2019-05-28-hola.md\\r\\n\u2502   \u251c\u2500\u2500 2019-05-29-hello-world.md\\r\\n\u2502   \u251c\u2500\u2500 2020-05-30-welcome.md\\r\\n\u2502   \u2514\u2500\u2500 authors.yml //global author usersage: -name yimin\\r\\n\u251c\u2500\u2500 docs\\r\\n\u2502   \u251c\u2500\u2500 doc1.md\\r\\n\u2502   \u251c\u2500\u2500 doc2.md\\r\\n\u2502   \u251c\u2500\u2500 doc3.md\\r\\n\u2502   \u2514\u2500\u2500 mdx.md\\r\\n\u251c\u2500\u2500 src\\r\\n\u2502   \u251c\u2500\u2500 components\\\\homepagefeatures\\r\\n|   \u2502   \u2514\u2500\u2500 index.js //main page center\\r\\n\u2502   \u251c\u2500\u2500 css\\r\\n\u2502   \u2502   \u2514\u2500\u2500 custom.css\\r\\n\u2502   \u2514\u2500\u2500 pages\\r\\n\u2502       \u251c\u2500\u2500 styles.module.css\\r\\n\u2502       \u2514\u2500\u2500 index.js\\r\\n\u251c\u2500\u2500 static\\r\\n\u2502   \u2514\u2500\u2500 img\\r\\n\u251c\u2500\u2500 docusaurus.config.js //main page\\r\\n\u251c\u2500\u2500 package.json\\r\\n\u251c\u2500\u2500 README.md\\r\\n\u251c\u2500\u2500 sidebars.js\\r\\n\u2514\u2500\u2500 yarn.lock\\r\\n```\\r\\n\\r\\n### Project structure rundown {#project-structure-rundown}\\r\\n\\r\\n- `/blog/` - Contains the blog Markdown files. You can delete the directory if you\'ve disabled the blog plugin, or you can change its name after setting the `path` option. More details can be found in the [blog guide]\\r\\n- `/docs/` - Contains the Markdown files for the docs. Customize the order of the docs sidebar in `sidebars.js`. You can delete the directory if you\'ve disabled the docs plugin, or you can change its name after setting the `path` option. More details can be found in the [docs guide]\\r\\n- `/src/` - Non-documentation files like pages or custom React components. You don\'t have to strictly put your non-documentation files here, but putting them under a centralized directory makes it easier to specify in case you need to do some sort of linting/processing\\r\\n  - `/src/pages` - Any JSX/TSX/MDX file within this directory will be converted into a website page. More details can be found in the [pages guide]\\r\\n- `/static/` - Static directory. Any contents inside here will be copied into the root of the final `build` directory\\r\\n- `/docusaurus.config.js` - A config file containing the site configuration. This is the equivalent of `siteConfig.js` in Docusaurus v1\\r\\n- `/package.json` - A Docusaurus website is a React app. You can install and use any npm packages you like in them\\r\\n- `/sidebars.js` - Used by the documentation to specify the order of documents in the sidebar  \\r\\n\\r\\n\\r\\n## authors.yml {#authors modify}  \\r\\n\\r\\n```bash\\r\\nyimin:\\r\\n  name: Yimin Qiu\\r\\n  title: Helper & learner\\r\\n  url: https://github.com/tony20141\\r\\n  image_url: https://avatars.githubusercontent.com/u/60122866?s=400&u=04bd04ca632e625b294ee33c3f4f549b626b2c8c&v=4\\r\\n\\r\\n\\r\\n```\\r\\n\\r\\n## Build {#build}\\r\\n\\r\\nDocusaurus is a modern static website generator so we need to build the website into a directory of static contents and put it on a web server so that it can be viewed. To build the website:\\r\\n\\r\\n```bash npm2yarn\\r\\nnpm run build\\r\\n```\\r\\n\\r\\nand contents will be generated within the `/build` directory, which can be copied to any static file hosting service like [GitHub pages](https://pages.github.com/), [Vercel](https://vercel.com/) or [Netlify](https://www.netlify.com/). Check out the docs on [deployment] for more details.\\r\\n\\r\\n\\r\\n[SUCCESS] Generated static files in \\"build\\".\\r\\n[INFO] Use `npm run serve` command to test your build locally."},{"id":"welcome-docusaurus-v2","metadata":{"permalink":"/blog/welcome-docusaurus-v2","source":"@site/blog/2024-01-21-linux/2024-01-21-Linux.md","title":"Linux note","description":"This is Linux study.","date":"2024-01-21T00:00:00.000Z","formattedDate":"January 21, 2024","tags":[{"label":"Linux","permalink":"/blog/tags/linux"},{"label":"CentOS","permalink":"/blog/tags/cent-os"}],"readingTime":5.7,"hasTruncateMarker":false,"authors":[{"name":"Yimin Qiu","title":"Helper & learner","url":"https://github.com/tony20141","imageURL":"https://avatars.githubusercontent.com/u/60122866?s=400&u=04bd04ca632e625b294ee33c3f4f549b626b2c8c&v=4","key":"yimin"}],"frontMatter":{"title":"Linux note","description":"This is Linux study.","slug":"welcome-docusaurus-v2","authors":["yimin"],"tags":["Linux","CentOS"],"image":"/blog/tiger-cartoon.jpg","hide_table_of_contents":false},"unlisted":false,"prevItem":{"title":"How to make a markdown website","permalink":"/blog/AAA"},"nextItem":{"title":"Welcome","permalink":"/blog/welcome"}},"content":"- [Linux \u547d\u4ee4](#linux-\u547d\u4ee4)\\r\\n  - [\u8fdb\u7a0b\u4f18\u5148\u7ea7 nice](#\u8fdb\u7a0b\u4f18\u5148\u7ea7-nice)\\r\\n    - [\u76f8\u5bf9\u4f18\u5148\u7ea7](#\u76f8\u5bf9\u4f18\u5148\u7ea7)\\r\\n  - [\u4f5c\u4e1a\u63a7\u5236 jobs](#\u4f5c\u4e1a\u63a7\u5236-jobs)\\r\\n    - [\u826f\u597d\u4e60\u60ef \u5b89\u88c5screen\u8f6f\u4ef6 \u53ef\u4ee5\u56de\u590d\u4e0a\u4e00\u6b21\u7684\u8fdb\u7a0b  \\\\`](#\u826f\u597d\u4e60\u60ef-\u5b89\u88c5screen\u8f6f\u4ef6-\u53ef\u4ee5\u56de\u590d\u4e0a\u4e00\u6b21\u7684\u8fdb\u7a0b--)\\r\\n  - [IO\u91cd\u5b9a\u5411\uff08\u5230\u4e00\u4e2a\u6587\u4ef6\u91cc\u9762\uff09](#io\u91cd\u5b9a\u5411\u5230\u4e00\u4e2a\u6587\u4ef6\u91cc\u9762)\\r\\n    - [\u7efc\u5408\u6848\u4f8b](#\u7efc\u5408\u6848\u4f8b)\\r\\n    - [\u7efc\u5408\u6848\u4f8b](#\u7efc\u5408\u6848\u4f8b-1)\\r\\n  - [subshell](#subshell)\\r\\n  - [\u7ba1\u9053 piping\uff08\u91cd\u5b9a\u5411\u5230\u4e00\u4e2a\u8fdb\u7a0b\uff09](#\u7ba1\u9053-piping\u91cd\u5b9a\u5411\u5230\u4e00\u4e2a\u8fdb\u7a0b)\\r\\n    - [\u5b9a\u4e49\u53ca\u7528\u9014](#\u5b9a\u4e49\u53ca\u7528\u9014)\\r\\n  - [\u5185\u90e8\u7ba1\u9053\u547d\u4ee4 tee \u5206\u6d41\u7528](#\u5185\u90e8\u7ba1\u9053\u547d\u4ee4-tee-\u5206\u6d41\u7528)\\r\\n  - [\u5206\u533a](#\u5206\u533a)\\r\\n  - [LVM \u903b\u8f91\u5206\u533a](#lvm-\u903b\u8f91\u5206\u533a)\\r\\n    - [Snap \u5feb\u7167\u5377 \u7528\u9014\uff1a\u8bb0\u5f55\u539f\u59cb\u5377\u53d8\u5316\uff0c\u7528\u5feb\u7167\u5377\u8fc5\u901f\u5907\u4efd\uff0c\u4fdd\u6301\u6570\u636e\u4e00\u81f4\u6027](#snap-\u5feb\u7167\u5377-\u7528\u9014\u8bb0\u5f55\u539f\u59cb\u5377\u53d8\u5316\u7528\u5feb\u7167\u5377\u8fc5\u901f\u5907\u4efd\u4fdd\u6301\u6570\u636e\u4e00\u81f4\u6027)\\r\\n\\r\\n\\r\\n# Linux \u547d\u4ee4\\r\\n\\r\\n## \u8fdb\u7a0b\u4f18\u5148\u7ea7 nice  \\r\\n\\r\\n### \u76f8\u5bf9\u4f18\u5148\u7ea7\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n## \u4f5c\u4e1a\u63a7\u5236 jobs  \\r\\n\\r\\n- \u4f5c\u4e1a\u63a7\u5236\u5141\u8bb8shell\u5728\u5b50\u8fdb\u7a0b\u8fd0\u884c\u671f\u95f4\u63a7\u5236\u7236\u8fdb\u7a0b  \\r\\n\\r\\n- \u524d\u53f0\u53ef\u4ee5ctrl+z\u6302\u540e\u53f0 \u7136\u540egf\u6062\u590d  \\r\\n\\r\\n`[root@CentOS~]# sleep 7000`   //\u7a0b\u5e8f\u5728\u524d\u53f0\u8fd0\u884c \u63a5\u53d7\u952e\u76d8\u63a7\u5236 \u53ef\u4ee5ctrl+z\u6682\u505c\u6302\u5728\u540e\u53f0  \\r\\n`[root@CentOS~]# sleep 7000 &`  //\u7a0b\u5e8f\u5728\u540e\u53f0\u8fd0\u884c \u4e0d\u63a5\u53d7\u952e\u76d8\u63a7\u5236  \\r\\n\\r\\n`[root@CentOS~]# jobs`                       //\u67e5\u770b\u73b0\u5728\u7684\u4f5c\u4e1a\\r\\n\\r\\n`ps aux |grep sleep`         //\u53ef\u4ee5\u67e5\u770bsleep\u7684\u8fdb\u7a0b S\u4e3a\u751f\u5728\u8fd0\u884c  \\r\\n\\r\\n`kill 2`       //\u6740PID\u4e3a2\u7684\u8fdb\u7a0b  \\r\\n`kill %2`      //\u6740\u4f5c\u4e1a\u53f7\u4e3a2\u7684\u8fdb\u7a0b  \\r\\n\\r\\n`sleep 5; ls; date`       //\u8fde\u7eed\u8fd0\u884c\u8fd9\u51e0\u4e2a\u547d\u4ee4  \\r\\n\\r\\n`while :; do date; sleep2; done &`          //\u8fdb\u7a0b\u5728\u540e\u53f0\u8fd0\u884c \u6bcf\u4e24\u79d2\u8f93\u51fa\u65e5\u671f  \\r\\n\\r\\n`fg`        //\u8c03\u5230\u524d\u53f0\u624d\u80fdctrl+c\u6740\u6389  \\r\\n\\r\\n### \u826f\u597d\u4e60\u60ef \u5b89\u88c5screen\u8f6f\u4ef6 \u53ef\u4ee5\u56de\u590d\u4e0a\u4e00\u6b21\u7684\u8fdb\u7a0b  `\\r\\n\\r\\n`[root@CentOS~]# ssh 10.0.0.1`       //\u8fdb\u4e3b\u673a  \\r\\n\\r\\n`[root@CentOS~]# yum -y install screen`  \\r\\n\\r\\n`[root@CentOS~]# screen -S Install_Session`       //\u6807\u6ce8\u73b0\u5728\u7684\u8fdb\u7a0b\u540d\u5b57  \\r\\n\\r\\n\u7a81\u7136\u65ad\u7f51  \\r\\n\\r\\n`[root@CentOS~]# screen list`  //\u770b\u8fdb\u7a0b\u6709\u4ec0\u4e48  \\r\\n\\r\\n`[root@CentOS~]# screen -r 29033`       //\u6062\u590d\u523029033\u8fdb\u7a0b  \\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n## IO\u91cd\u5b9a\u5411\uff08\u5230\u4e00\u4e2a\u6587\u4ef6\u91cc\u9762\uff09  \\r\\n- \u8fdb\u7a0b\u6bcf\u6253\u5f00\u4e00\u4e2a\u6587\u4ef6\u90fd\u4f1a\u6709\u4e00\u4e2a\u5bf9\u5e94\u7684\u6570\u5b57\u6807\u8bc60\uff08\u952e\u76d8\u8f93\u5165\uff09\u30011\uff08\u663e\u793a\u5668\u8f93\u51fa\uff09\u30012\uff08\u663e\u793a\u5668\u9519\u8bef\u8f93\u51fa\uff09\u30013\u30014\u3002\u3002\u3002\uff08\u8f93\u51fa\u5230\u6587\u4ef6\u6216\u8005\u4ece\u6587\u4ef6\u8f93\u5165\uff09  \\r\\n- \u6b64\u6807\u8bc6\u53eb\u505afile description  \\r\\n- \'>\' \u8868\u793a\u8f93\u51fa\u5e76\u8986\u76d6 \'>>\'\u8868\u793a\u8f93\u51fa\u5e76\u52a0\u5230\u540e\u9762  \\r\\n\\r\\n\\r\\n\\r\\n  `[root@CentOS~]# tty`       //\u770b\u76ee\u524d\u7ec8\u7aef\u53f7  \\r\\n  /dev/pts/3  \\r\\n  `[root@CentOS~]# date >/dev/pts/4`        //\u628a\u65e5\u671f\u8f93\u51fa\u7ed3\u679c1\u91cd\u5b9a\u5411\u52304\u53f7\u7ec8\u7aef\u53bb  \\r\\n  `[root@CentOS~]# ll /proc/$$/fd`        //\u770b\u76ee\u524d$$\u8fdb\u7a0b\u7684\u6807\u8bc6 01234  \\r\\n  `[root@CentOS~]# date 1> date.txt`        //\u628a\u6b63\u786e\u8f93\u51fa\u5230\u663e\u793a\u5668\u7684\u641e\u5230\u6587\u4ef6\u53bb \u91cd\u5b9a\u5411  \\r\\n  `[root@CentOS~]# cate 0< /etc/hosts`        //\u8f93\u5165\u91cd\u5b9a\u5411 \u4e0d\u4ece\u952e\u76d8\u8981\u6587\u4ef6  \\r\\n\\r\\n\\r\\n  `[root@CentOS~]# cat 1>file1.txt <<-EOF`           //\u811a\u672c\u8f93\u5165\u4e0d\u9700\u8981\u6309ctrl+D\u7ed3\u675f \u5176\u4e2d-\u53ef\u4ee5\u5ffd\u7565\u811a\u672c\u4e2d\u7684tab\u952e\u7f29\u8fdb  \\r\\n     `[root@CentOS~]# vim jiaoben.sh`\\r\\n     \\r\\n     `[root@CentOS~]# bash jiaoben.sh`  \\r\\n\\r\\n     \\r\\n     //\u7eaf\u8f93\u51fa\u4e00\u6bb5\u6587\u5b57  \\r\\n\\r\\n### \u7efc\u5408\u6848\u4f8b\\r\\n`[root@CentOS~]# ls; date &>/dev/null`       //\u5e0c\u671b\u4e24\u6761\u90fd\u91cd\u5b9a\u5411\uff0c\u5374\u53ea\u91cd\u5b9a\u5411\u4e86;\u540e\u9762\u7684\uff0cls\u4ecd\u65e7\u663e\u793a\u4e86   \\r\\n\\r\\n`[root@CentOS~]# ls &>/dev/null; date &>/dev/null`        //\u5168\u90e8\u91cd\u5b9a\u5411\u5230null  \\r\\n\u53ef\u4ee5\u7b80\u5199`[root@CentOS~]# (ls ; date) &>/dev/null`  \\r\\n\\r\\n\\r\\n### \u7efc\u5408\u6848\u4f8b  \\r\\n\\r\\n\\r\\n## subshell  \\r\\n\\r\\n\\r\\n- \u6bcf\u4e24\u79d2\u5728\u540e\u53f0\u628adate\u53d1\u9001\u5230date.txt  \\r\\n\\r\\n\\r\\n## \u7ba1\u9053 piping\uff08\u91cd\u5b9a\u5411\u5230\u4e00\u4e2a\u8fdb\u7a0b\uff09  \\r\\n\\r\\n### \u5b9a\u4e49\u53ca\u7528\u9014  \\r\\n- \u7528\u91cd\u5b9a\u5411character\u8f93\u51fa\u5230\u4e00\u4e2a\u6587\u4ef6  \\r\\n- \u63a7\u5236\u8f93\u51fa\u5230\u53e6\u4e00\u4e2a\u7a0b\u5e8f  \\r\\n- \u5982\u56fe \u901a\u8fc7\u7ba1\u9053\u8f93\u51fa\u5230\u4e0b\u4e00\u4e2a\u8fdb\u7a0b\u7684\u8f93\u5165  \\r\\n \\r\\n\\r\\n- \u7528less\u547d\u4ee4\u548c\u8fc7\u6ee4grep\u793a\u4f8b  \\r\\n\\r\\n\\r\\n- \u7528--sort \u53c2\u6570\u6392\u5217cpu \u5e76\u4e14\u53ea\u5217\u524d6\u9879  \\r\\n\\r\\n![picture](./2023-04-23-13-28-35.png)\\r\\n\\r\\n## \u5185\u90e8\u7ba1\u9053\u547d\u4ee4 tee \u5206\u6d41\u7528\\r\\n\\r\\n- \u53ef\u4ee5\u628a\u547d\u4ee4\u5199\u597d\u540e \u518d\u628atee\u63d2\u5165\u5230\u60f3\u8981\u7684\u4f4d\u7f6e\u201c\u524d\u9762\u201d \u5c31\u53ef\u4ee5\u5206\u6d41  \\r\\n- tee \u662f\u91cd\u5b9a\u5411\u5230\u4e00\u4e2a\u8fdb\u7a0b  \\r\\n\\r\\n\\r\\n\\r\\n\\r\\n## \u5206\u533a  \\r\\n\\r\\n- fdisk \u547d\u4ee4\u7ed9MBR\u5206\u533a \u8001\u5f0f 4\u4e3b\u5206\u533a+\u6269\u5c55  \\r\\n- gdisk \u547d\u4ee4\u7ed9GPT\u5206\u533a \u65e0\u9650\u4e3b\u5206\u533a  \\r\\n- mkfs.xfs /dev/vda1 or mkfs.ext4 /dev/vda1 \u683c\u5f0f\u5316  \\r\\n- mount -t xfs -o ro /dev/vda1 /mnt/date1 #\u628a/vda1\u786c\u76d8\u6302\u8f7d\u5230data1\u6587\u4ef6\u5939 -t\u58f0\u660exfs\u6216\u8005ext4\uff0c\u53ef\u4ee5\u4e0d\u5199\uff0c-o ro\u662f\u53ea\u8bfb\uff0c\u53ef\u4ee5\u4e0d\u5199\uff0c\u9ed8\u8ba4\u8bfb\u5199  \\r\\n- mount /dev/vda1 /mnt/date1 \u6302\u8f7d\u70b9\u53ef\u4ee5\u662f\u4efb\u610f\u4e00\u4e2a\u76ee\u5f55\\r\\n- blkid /dev/vda1    \u7ed3\u679cUUID = \u201c*******\u201d  \\r\\n- mount UUID = \\"******\\" \u63a8\u8350\u6309\u7167UUID\u6302\u8f7d\\r\\n\\r\\n## LVM \u903b\u8f91\u5206\u533a\\r\\n\\r\\n### Snap \u5feb\u7167\u5377 \u7528\u9014\uff1a\u8bb0\u5f55\u539f\u59cb\u5377\u53d8\u5316\uff0c\u7528\u5feb\u7167\u5377\u8fc5\u901f\u5907\u4efd\uff0c\u4fdd\u6301\u6570\u636e\u4e00\u81f4\u6027    \\r\\n- \u521b\u5efa `lvcreate -L 50M -n lv1-snap -s /dev/datavg/lv1` \u7ed9/dev/datavg/lv1 \u903b\u8f91\u5377\u521b\u5efa\u4e00\u4e2a\u53eb\u505alv1-snap\u7684\u5feb\u7167\u5377\uff0c\u6307\u5b9a50MB\uff0c\u539f\u59cb\u5377\u53ef\u4ee5\u5927\u4e8e50MB  \\r\\n- \u6ce8\u610f\u4e8b\u9879\uff1a\u5feb\u7167\u5377\u548c\u539f\u59cb\u5377\u5fc5\u987b\u5728\u540c\u4e00VG\\r\\n- \u6ce8\u610f \u53ea\u80fdext4"},{"id":"welcome","metadata":{"permalink":"/blog/welcome","source":"@site/blog/2021-08-26-welcome/index.md","title":"Welcome","description":"Docusaurus blogging features are powered by the blog plugin.","date":"2021-08-26T00:00:00.000Z","formattedDate":"August 26, 2021","tags":[{"label":"facebook","permalink":"/blog/tags/facebook"},{"label":"hello","permalink":"/blog/tags/hello"},{"label":"docusaurus","permalink":"/blog/tags/docusaurus"}],"readingTime":0.405,"hasTruncateMarker":false,"authors":[{"name":"Yimin Qiu","title":"Helper & learner","url":"https://github.com/tony20141","imageURL":"https://avatars.githubusercontent.com/u/60122866?s=400&u=04bd04ca632e625b294ee33c3f4f549b626b2c8c&v=4","key":"yimin"}],"frontMatter":{"slug":"welcome","title":"Welcome","authors":"yimin","tags":["facebook","hello","docusaurus"]},"unlisted":false,"prevItem":{"title":"Linux note","permalink":"/blog/welcome-docusaurus-v2"}},"content":"[Docusaurus blogging features](https://docusaurus.io/docs/blog) are powered by the [blog plugin](https://docusaurus.io/docs/api/plugins/@docusaurus/plugin-content-blog).\\n\\nSimply add Markdown files (or folders) to the `blog` directory.\\n\\nRegular blog authors can be added to `authors.yml`.\\n\\nThe blog post date can be extracted from filenames, such as:\\n\\n- `2019-05-30-welcome.md`\\n- `2019-05-30-welcome/index.md`\\n\\nA blog post folder can be convenient to co-locate blog post images:\\n\\n![Docusaurus Plushie](./docusaurus-plushie-banner.jpeg)\\n\\nThe blog supports tags as well!\\n\\n**And if you don\'t want a blog**: just delete this directory, and use `blog: false` in your Docusaurus config."}]}')}}]);